import React from 'react';
import { Row, Col } from 'antd';
import UserInfo from './UserInfo';
import RoomList from './RoomList';

const Sidebar = () => {
   return (
      <Row>
         <Col span={24}>
            <UserInfo />
         </Col>
         <Col span={24}><RoomList /></Col>
      </Row>
   );
}

export default Sidebar;
